 List<List<int>> splitBinaryString(String binaryString, int size) {
   List<List<int>> result = [];

   binaryString = binaryString.replaceAll(RegExp(r'[^01]'), '');

   List<int> binaryList = binaryString.split('').map(int.parse).toList();


   for (int i = 0; i < binaryList.length; i += size) {
     // گرفتن زیرلیست با اندازه مشخص
     int end = (i + size < binaryList.length) ? i + size : binaryList.length;
     List<int> subArray = binaryList.sublist(i, end);
     result.add(subArray);
   }

   return result;
 }






